import React, { Component } from "react";
import { Helmet } from "react-helmet";

class Result extends Component {
  render () {
    return (
        <div className="application">

            <Helmet>
            <script async src="https://widget.budgetyourtrip.com/location-widget-js/US" type="text/javascript"></script><a href="https://www.budgetyourtrip.com/united-states-of-america" target="_blank" class="budgetyourtrip-logo-pushdown" rel="noopener">United States of America Travel Costs</a>
            </Helmet>
            ...
        </div>
    );
  }
};

export default Result;
